import React from 'react';
import FullCalendar from '@fullcalendar/react';
import dayGridPlugin from '@fullcalendar/daygrid';
import timeGridPlugin from '@fullcalendar/timegrid';

function ManageOrder() {
    const resources = [
        { id: 'a', title: 'Resource A' },
        { id: 'b', title: 'Resource B' },
        { id: 'c', title: 'Resource C' },
      ];
    
      const events = [
        { id: '1', title: 'Event 1', resourceId: 'a', start: '2023-10-09T10:00:00', end: '2023-10-09T12:00:00' },
        { id: '2', title: 'Event 2', resourceId: 'b', start: '2023-10-09T14:00:00', end: '2023-10-09T16:00:00' },
        { id: '3', title: 'Event 3', resourceId: 'c', start: '2023-10-09T08:00:00', end: '2023-10-09T10:00:00' },
      ];
    
      return (
        <FullCalendar
          plugins={[dayGridPlugin, timeGridPlugin]}
          initialView="timeGridWeek"
          resources={resources}
          events={events}
        />
      );
}

export default ManageOrder;
